Result<T, E>, for OO programmers, looks like like a 'parent' return type. OO programmers can use parent types to easily return the more specific errors in sub-class instances. Result<T, E> doesn't do this. Exactly, like Option<T>, Results are unwrapped, typically with a match statement. But, the reasoning process for Results vs. Options is not the not the same and introduces one additional step With Options: Option<T> | Some or None | | We know our T and get to work Missing, handle accordingly But, with Results: Result<T, E> | Ok or Err | | We know our T and get to work We *might* have an Error (a trait) | We find the specific error for return type size | We return Result handling the content behind Err with full knowledge of its underlying type In OO programming we have the luxury of handling errors without knowing all the details, because if an error is thrown or I throw an error, we at least know it derives from an Error (typically an Exception class). In Rust, however, we must know the exact content of the Result's Err in order to handle it completely. In fact the E in Result<T, E> needn't be an Error (deriving from the Error trait) at all (a String here for illustrative purpose): fn main() -> Result<(), Box<String>> { let function_result = is_positive(-2); println!("{:?}", function_result?); Ok(())
} fn is_positive(number: i64) -> Result<(), String> { if number < 0 { return Err("emergency failure".to_string()); } Ok(())
} An additional layer of digging is often required because, aside from the above, types including Result<T, E> are frequently aliased, e.g.: type AliasedResult<T> = Result<T, String>; fn main() -> AliasedResult<()> { let function_result = is_positive(-2); println!("{:?}", function_result?); Ok(())
